import p from '../../img/profile.png';
import { makeStyles } from '@material-ui/core/styles';
import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import { signIn } from '../../store/actions/signIn';
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import AccountCircle from '@material-ui/icons/AccountCircle';
import "./Login.scss"

const useStyles = makeStyles((theme) => ({
  margin: {
    margin: theme.spacing(1),
  },
}));
const SignIn = (props) => {
  const classes = useStyles();
  let email = "";
  let [password,setPassword]=useState("");
  
  return (
    <form className={classes.root} noValidate autoComplete="off">
      <img className='profile_img' src={p}></img>
     
      <TextField onChange={(e) => { email = e.target.value }} required
        className={classes.margin}
        id="input-with-icon-textfield"
        placeholder="Email"

        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
    
      <TextField 
        className={classes.margin}
        id="input-with-icon-textfield"
        placeholder="Password"
        onChange={(e) => { setPassword( e.target.value )} }
        required
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
     
      <Button variant="contained" onClick={() => signIn(password, email)}>Login</Button>    { password==""?<h2>Forgot Password?</h2>:<h2>vfcry</h2>}

    </form>
  );
}

export default SignIn;
